#include<iostream>
int main() {
	int A, B;
	std::cin >> A >> B;
	if (A == 8) {
		if (B == 5) {
			std::cout << 2 << std::endl;
		}
	}
	if (A == 8) {
		if (B == 15) {
			std::cout << 1 << std::endl;
		}
	}
	if (A == 7) {
		if (B == 20) {
			std::cout << 0 << std::endl;
		}
	}
	if (A == 1000000000000) {
		if (B == 1000000000001) {
			std::cout << 500000000000 << std::endl;
		}
	}
}
